import React, { useEffect } from "react";
import {Gatepool} from '/Gatepool'

function Tasks() {
const [tasks, setTasks] = React.useState([]);

  useEffect(() => 
  {
    fetch("/fecthtasks").then((response) =>
      response.json().then((data) => {
        setTasks(data);
      })
    );
  }, []);
  return  (
    <Gatepool tasks={tasks} />

  );
}

export default Tasks;
